import React from 'react';
import logo from './logo.svg';
import './App.css';

const App = function() {
  return ( 
    <div className="App"> 

      <header className="header">
        <img src="images/imagelogo.jpg" />
        Header
      </header>

      <nav className="nav">
        HiperNav
      </nav>

      <main>
        Main content
      </main>

    </div> 
  );
}

export default App;
